import { serviceWithDrawal, serviceReject, serviceApprove } from '../../services/webServices.js';
import { DO_LIST_WITHDRAWAL, LIST_WITHDRAWAL_SUCCESS, LIST_WITHDRAWAL_FAILED, RESET_LIST_WITHDRAWAL, DO_REJECT, REJECT_FAILDED, DO_APPROVE, REJECT_SUCCESS, APPROVE_SUCCESS, APPROVE_FAILED } from '../../config/constant.js';


//WITHDRAWAL ACTION
export function withdrawalAction(dispact, params, token) {
  dispact(doWithdrawal())
  return serviceWithDrawal(params, token)
    .then(res => {
      dispact(listWhithdrawalSuccess(res.data, res.meta));
    })
    .catch(err => {
      return dispact(listWhithdrawalFailed(false))
    })
}

//RESET WITHDRAWAL
export function resetWithdrawal(dispact) {
  dispact(resetWithdrawalSuccess());
}
function doWithdrawal() {
  return {
    type: DO_LIST_WITHDRAWAL
  }
}
function listWhithdrawalSuccess(payload, meta) {
  return {
    type: LIST_WITHDRAWAL_SUCCESS,
    data: payload,
    meta: meta
  }
}
function listWhithdrawalFailed() {
  return {
    type: LIST_WITHDRAWAL_FAILED
  }
}
function resetWithdrawalSuccess(payload) {
  return {
    type: RESET_LIST_WITHDRAWAL,
    data: payload
  }
}

// REJECT WITHDRAWAL
export function rejectWithdrawal(dispact, id, token, callback) {
  dispact(doReject());
  return serviceReject(id, token)
    .then(res => {
      dispact(rejectSuccess(res));
      callback.call(this, res);
    })
    .catch(() => {
      return dispact(rejectFailed(false));
    });
}

function doReject() {
  return {
    type: DO_REJECT
  }
}
function rejectSuccess(payload) {
  return {
    type: REJECT_SUCCESS,
    data: payload
  }
}
function rejectFailed() {
  return {
    type: REJECT_FAILDED
  }
}

// APPROVE WITHDRAWAL
export function approveWithdrawal(dispact, id, token, callback) {
  dispact(doApprove());
  return serviceApprove(id, token)
    .then(res => {
      dispact(approveSuccess(res));
      callback.call(this, res);
    })
    .catch(() => {
      return dispact(approveFailed(false));
    });
}

function doApprove() {
  return {
    type: DO_APPROVE
  }
}
function approveSuccess(payload) {
  return {
    type: APPROVE_SUCCESS,
    data: payload
  }
}
function approveFailed() {
  return {
    type: APPROVE_FAILED
  }
}
